Billie Turf Contra Kwel



Nederland
Familie
93 minuten

geregisseerd door Henk van der Linden
met Raymond van Haaf, Jan Kruyk en Frans Keulen

Internaat Denheuvel. Billie Turf, het dikste studentje ter wereld, ligt altijd in de clinch met meester Kwel. Deze keer studeert Turf hypnose, geeft hij zich uit voor barones en komen er dieven die het op het schoolgeld voorzien hebben. 





